(145539, 'للبيع 250م اللاسلكي مقابل القمر الصناعي تقسيم الخطيب', 'للبيع 250م اللاسلكي مقابل القمر الصناعي تقسيم الخطيب', 'للبيع شقة تحفة في ارقى موقع اللاسلكي تقسيم الخطيب مقابل القمر الصناعي 250م 3غرف نوم و3حمام ماستر ورسبسن 4قطع ولفنج ومطبخ تشطيب اكسترا سوبر لوكس واجهه دور رابع 2اسانسير حصة بالجراج واجهه مميزة مدخل شيك بلكونات TM 205', 'aaaaaaaaa', 0, 1, NULL, 1, NULL, 250, 3, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-20 05:11:01', '2021-06-20 05:11:01', 1, 1, 1, NULL, NULL, NULL, 1, 1, 1, 2, 1, 2600000, 1, 1, 1, 24, 15, NULL),
(145540, 'للبيع شقة في ارقى موقع في اللاسلكي مقابل القرية الذكية', 'للبيع شقة في ارقى موقع في اللاسلكي مقابل القرية الذكية', 'للبيع شقة في ارقى موقع في اللاسلكي مقابل القرية الذكية فيو تحفة 205م 3غرف نوم و2حمام ماستر ورسبسن ثلاث قطع ومطبه تشطيب اكترااا سوبر لوكس واجهه دور خامس اسانسير مدخل شيك امن 24 ساعة TT 54', 'aaaaaaaaa', 0, 1, NULL, 1, NULL, 205, 3, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-20 05:26:46', '2021-06-20 05:26:46', 1, 1, 1, NULL, NULL, NULL, 1, 1, 1, 1, 1, 1950000, 1, 1, 2, 24, 15, NULL),
(145541, 'للبيع شقة 135م المعادي اول شارع فلسطين', 'للبيع شقة 135م المعادي اول شارع فلسطين', 'للبيع شقة في المعادي اول شارع فلسطين من شارع الجزائر 135م 3غرف نوم و32حمام ورسبسن قطعتين ومطبخ تشطيب لوكس دور اول فوق الارضي جراج واجهه TNG 696', 'aaaaaaaaa', 0, 1, NULL, 1, NULL, 135, 3, 2, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-20 05:39:56', '2021-06-20 05:39:56', 1, 1, 1, NULL, NULL, NULL, 1, 1, 1, 1, 1, 950000, 1, 1, 1, 2, 15, NULL),
(145543, 'للبيع شقة 210م كمباوند جراند سيتي يالمرشدي', 'للبيع شقة 210م كمباوند جراند سيتي يالمرشدي', 'للبيع شقة 175م كمباوند جراند سيت يالمرشدي 3غرف و2حمام ورسبسن دور خامس فيو الندي 2اسانير\r\nهناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها. ولذلك يتم استخدام طريقة لوريم إيبسوم لأنها تعطي توزيعاَ طبيعياَ -إلى حد ما- للأحرف عوضاً عن استخدام \"هنا يوجد محتوى نصي، هنا يوجد محتوى نصي\" فتجعلها تبدو (أي الأحرف) وكأنها نص مقروء. العديد من برامح النشر المكتبي وبرامح تحرير صفحات الويب تستخدم لوريم إيبسوم بشكل إفتراضي كنموذج عن النص، وإذا قمت بإدخال \"lorem ipsum\" في أي محرك بحث ستظهر العديد من المواقع الحديثة العهد في نتائج البحث. على مدى السنين ظهرت نسخ جديدة ومختلفة من نص لوريم إيبسوم، أحياناً عن طريق الصدفة، وأحياناً عن عمد كإدخال بعض العبارات الفكاهية إليه', 'aaaaaaaaa', 0, 1, NULL, 1, NULL, 175, 3, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-20 06:35:20', '2021-06-20 06:35:20', 1, 1, 1, NULL, NULL, NULL, 1, 1, 1, 1, 1, 1650000, 1, 1, 1, 24, 15, NULL),
(145557, 'للبيع شقة 195م جراند سيتي المرشدي', 'للبيع شقة 195م جراند سيتي المرشدي', 'للبيع شقة في كمباوند جراند سيتي المرشدي فيو النادي 195م 3غرف نوم 3حمام رسبسن 3قطع ومطبخ تشطيب سوبر لوكس واجهه ور رابع مدخل شيك امن', 'aaaaaaaaa', 0, 1, 1, 1, NULL, 195, 3, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-06-25 19:03:30', '2021-06-25 19:03:30', 1, 1, 1, NULL, NULL, NULL, 25, 1, 1, 2, 1, 1450000, 2, 1, 1, 24, 15, NULL);
