INSERT INTO `pages` (`id`, `page_name`, `description`) VALUES
(1, 'terms_conditions', '\r\n				<h3 class=\"title-icon\">الشروط والاحكام</h3>\r\n\r\n				<p> المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي للنص أو شكل توضع الفقرات في\r\n\r\n					الصفحة التي يقرأها. هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن\r\n\r\n					التركيز على الشكل الخارجي للنص أو شك</p>\r\n\r\n				<ul class=\"li-icon\">\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n\r\n\r\n				</ul>\r\n\r\n				<!-- refund policy -->\r\n\r\n				<h5>سياسة الاسترجاع</h5>\r\n\r\n				<p> المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي للنص أو شكل توضع الفقرات في\r\n\r\n					الصفحة التي يقرأها. هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن\r\n\r\n					التركيز على الشكل الخارجي للنص أو شك</p>\r\n\r\n				<!--website disclamer -->\r\n\r\n				<h5>إخلاء مسؤولية</h5>\r\n\r\n				<ul class=\"li-icon\">\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n					<li>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n						الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</li>\r\n\r\n				</ul>\r\n\r\n				<!-- privacy policy -->\r\n\r\n				<h5>سياسه الخصوصيه</h5>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n					الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n					الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n				<!--secuirty-->\r\n\r\n				<h5>الامان</h5>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n					الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n				<!-- credit card information -->\r\n\r\n				<h5>معلومات بطاقة الائتمان</h5>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n					الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n\r\n\r\n\r\n\r\n				<!-- Credit card -->\r\n\r\n\r\n\r\n				<h5>كيف نستخدم ملفات تعريف الارتباط</h5>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء لصفحة ما سيلهي القارئ عن التركيز على الشكل\r\n\r\n					الخارجي للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء ما سيلهي القارئ عن التركيز على الشكل الخارجي\r\n\r\n					للنص أو شكل توضع الفقرات في الصفحة التي يقرأه لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي\r\n\r\n					للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n\r\n\r\n				<!-- Link to ither websites -->\r\n\r\n\r\n\r\n\r\n\r\n				<h5>الارتباط بمواقع أخرى</h5>\r\n\r\n				<p>هناك حقيقة مثبتة منذ زمن طويل وهي أن المحتوى المقروء ما سيلهي القارئ عن التركيز على الشكل الخارجي\r\n\r\n					للنص أو شكل توضع الفقرات في الصفحة التي يقرأه لصفحة ما سيلهي القارئ عن التركيز على الشكل الخارجي\r\n\r\n					للنص أو شكل توضع الفقرات في الصفحة التي يقرأها.</p>\r\n\r\n\r\n'),
(2, 'about_us', '  <div class=\"row\">\r\n            <div class=\"col-md-6 col-lg-6 d-flex align-items-stretch mb-5 mb-lg-0\">\r\n              <div class=\"icon-box\" data-aos=\"fade-up\" data-aos-delay=\"100\">\r\n                <div class=\"icon\"><i class=\"far fa-eye\"></i></div>\r\n                <h4 class=\"title\"><a href=\"\">الرؤيه</a></h4>\r\n                <p class=\"description\">\r\n\r\n\r\n نصبح أول منصة عقارية داخل جمهوية مصر العريبة وفي بقية الدول في العالم\r\n				\r\n				</p>\r\n              </div>\r\n            </div>\r\n  \r\n          \r\n  \r\n            <div class=\"col-md-6 col-lg-6 d-flex align-items-stretch mb-5 mb-lg-0\">\r\n              <div class=\"icon-box\" data-aos=\"fade-up\" data-aos-delay=\"300\">\r\n                <div class=\"icon\"><i class=\"far fa-gem\"></i></div>\r\n                <h4 class=\"title\"><a href=\"\">القيمه</a></h4>\r\n                <p class=\"description\">\r\n\r\nتوفير منصة رقمية سهلة الاستخدام تربط كل المهتمين بالبحث عن فرص مميزة في العقارات بيع وشراء وايجار \r\n				\r\n				\r\n				</p>\r\n              </div>\r\n            </div>\r\n  \r\n			<div class=\"col-md-12 col-lg-12 d-flex align-items-stretch mt-5 mb-lg-0\">\r\n				<div class=\"icon-box\" data-aos=\"fade-up\" data-aos-delay=\"200\">\r\n				  <div class=\"icon\"><i class=\"fas fa-bullseye\"></i></div>\r\n				  <h4 class=\"title\"><a href=\"\">الهدف</a></h4>\r\n				  <p class=\"description\">\r\n  \r\n  \r\n					  يهدف الموقع الى اتاحة تاحة أكبر عدد من العقارات للمستخدمين، وتسهيل عملية البيع والشراء من خلال إتاحة الوحدات العقارية المعروضة للبيع والايجار بواسطة ملاك الوحدات مباشرة بدون أي وسيط عقاري او سمسار او شركات تسويق ععاري وبدون دفع عمولات عن الشراء او الايجار وكذلك البحث عن افضل الشركات للتشطيبات واعمال الديكور وشركات نقل الاثاث وشركات بيع الاثاث المنزلي والمكتبي وشركات بيع الاجهزة الكهربائية\r\n				  \r\n				  </p>\r\n				</div>\r\n			  </div>\r\n  \r\n          </div>');
